import React, { Component } from 'react';
import Cookies from 'universal-cookie'
import { 
  Header,
  Skills,
  Projects,
  Location,
  Contact,
  Footer,
  Nav
} from '../../Components';
import '../../App.css';
import './style.css'

const Home = (props) => {
  return (
    <div>
      <Nav />
      <div className='section projects-section'></div>
      <div className='section skills-section'></div>
      <div className='section contact-section'></div>
      <div className='section resume-section'></div>
    </div>
  )
}

export default Home;
